import React from "react";
import btg from "../images/btg.png";

const Projects = () => {
  return (
    <>
      <div>
        <a
          href="http://bridgethegap-2011capstone.herokuapp.com/"
          target="_blank"
          rel="noreferrer"
          className="linktext"
        >
          <img src={btg} />
        </a>
      </div>
    </>
  );
};

export default Projects;
